import{_ as e,o as r,c as o,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 18.2-474 Delivery of articles to prisoners or committed person.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-474.md","filePath":"vacode/18.2-474.md"}'),i={name:"vacode/18.2-474.md"},n=t('<h1 id="§-18-2-474-delivery-of-articles-to-prisoners-or-committed-person" tabindex="-1">§ 18.2-474 Delivery of articles to prisoners or committed person. <a class="header-anchor" href="#§-18-2-474-delivery-of-articles-to-prisoners-or-committed-person" aria-label="Permalink to &quot;§ 18.2-474 Delivery of articles to prisoners or committed person.&quot;">​</a></h1><p>No person shall willfully in any manner deliver, or attempt to deliver, to any prisoner confined under authority of the Commonwealth of Virginia, or of any political subdivision thereof, or to any person committed to the Department of Juvenile Justice in any juvenile correctional center, any article of any nature whatsoever, without first securing the permission of the person in whose charge such prisoner or committed person is, and who may in his discretion grant or refuse permission. Any person violating this section is guilty of a Class 1 misdemeanor.</p><p>Nothing herein contained shall be construed to repeal or amend § <a href="http://law.lis.virginia.gov/vacode/18.2-473/" target="_blank" rel="noreferrer">18.2-473</a>.</p><p>Code 1950, § 18.1-285; 1960, c. 358; 1975, cc. 14, 15; 2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0707" target="_blank" rel="noreferrer">707</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0782" target="_blank" rel="noreferrer">782</a>.</p>',4),a=[n];function s(c,l,p,d,h,m){return r(),o("div",null,a)}const v=e(i,[["render",s]]);export{_ as __pageData,v as default};
